import React from 'react';
import Book from './book'




const bookList = (props) => {




    console.log(props)
       return (
        <div >

           <h1>BoekenLijst</h1>



           { props.books.map( book => <Book key={book.Id} auteur={book.auteur} title={book.title} jaar={book.jaar} price={book.price} / >)   }


        </div>
    );

};

export default bookList;
